import ApexCharts from "react-apexcharts";
import $ from 'jquery';
function Chart() {

  var options = {
    chart: {
      type: 'bar'
    },
    series: [{
      data: [3, 16, 2, 14, 15, 7, 9, 21, 7, 5, 4],
  },{
      data: [11, 2, 3, 1, 10, 13, 7, 8, 21, 22, 3],
  }],
    xaxis: {
      categories: [1991,1992,1993,1994,1995,1996,1997, 1998,1999]
    }
  }

    return <ApexCharts
    options={options}
    series={options.series}
    typs={options.chart}
    width={500}
    height={300}
    />
}
export default Chart;
